    [],nt"num_tags": 7,nt"name": "acquisition-and-development-of-biological-and-geographical-spatial-data-for-walnut-cr-1990",nt"isopen":
    false,nt"url": null,nt"notes": "Baseline information on topography, soils,
    vegetation, transportation, land ownership, and surface water was acquired and GIS
    data files prepared. The data were used to prepare environmental assessments and
    impact statements required for the establishment of Walnut Creek National Wildlife
    Refuge.    Additional GIS data layers were prepared as needed from available imagery
    and data files to perform specific inventory and research activities. Most data
    files are stored in ARC/INFO format but many files have been converted to MIPS and
    EPPL7 formats as well. Vegetation and land use data was verified in 1991 by on-the-ground
    surveys. Additional data were acquired on soils and aerial photography (1986, 1989,
    1990, 1991) from four separate sources and digitized. Original land survey township
    maps were digitized.    An inventory of prairie remnants in a 38-county area surrounding
    Walnut Creek NWR was initiated to identify potential sources of seeds to be used
    in prairie reconstruction. A GIS data base was designed to provide geographic location
    and site quality information for each of the sources located. Original field data
    records of seed source information was provided to the refuge.    A faunal survey
    was initiated in 1994 to obtain baseline information on birds, mammals, and selected
    invertebrate groups including butterflies, moths, ants, grasshoppers, and ground-dwelling
    invertebrates. Voucher specimens of invertebrates are temporarily stored at the
    Iowa Cooperative Fish & Wildlife Research Unit until completion of laboratory space
    in the refuge's research laboratories.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
